import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import Data from "../data";



function App() {
  return (
    <div>
      <Header />
      <Footer />
      {Data.map( data => {
  return <Note key={data.key} title={data.title} content={data.content} />;
})};
    </div>
  );
}

export default App;
